import React from "react";
import "./index.css";

const App = () => {
  return (
    <div className="app-container">
      <div className="flex-container">
        <img
          src="./logoseaherbs.png"
          alt="Logo Sea Herbs"
          className="logo"
          style={{ width: "400px", height: "auto" }}
        />
        <div className="container">
          <input
            type="text"
            placeholder="Search..."
            className="input"
            style={{
              background: "transparent",
              border: "1px solid black",
              borderRadius: "15px",
              outline: "none",
              width: "500px",
              height:"50px",
              fontWeight: "100",
              fontSize: "30px",
              transition: "0.8s",
              padding: "20px",
            }}
          />
        </div>
      </div>
    </div>
  );
};

export default App;
